Volvió el futbol internacional y que mejor manera que con la UEFA Nations League. Holanda recibió a Polonia en su primer partido de esta competencia. Con gol de Bergwijn, la naranja mecánica se llevó los 3 puntos.

El primer tiempo fue muy vistoso. Se notaba que ambos equipos buscaban la victoria y el nivel de juego era alto. Polonia, a pesar de estar sin Lewandowski, genero peligro en el área rival, pero no tuvieron efectividad de cara a gol. Por otro lado, los locales eran dueños de la posesión de balón y el medio campo holandés controlaba los tempos del partido. Los primeros 45 minutos terminaron 0x0.

Durante la segunda mitad, la balanza se inclinó aún más en favor de los holandeses. Frenkie De Jong y Memphis Depay estaban a cargo de la creación de juego y la generación de peligro. Al minuto 61, es el mediocampista del FC Barcelona el encargado de meter un pase bombeado a Hateboer para que el lateral habilite a Bergwijn y abra el marcador. Polonia intentó volver a meterse en el partido, pero la solidez defensiva de Holanda evitó que generen peligro.

Con esta victoria Holanda está primera en su grupo. El lunes, la naranja mecánica se enfrentará a Italia mientras que Polonia visitará a Bosnia Herzegovina. ❤️⚽
